import React,{useState, useEffect} from 'react'
import PetsIcon from '@material-ui/icons/Pets';

const Loading=()=> {
    const [loading, setLoading] = useState(true);
    useEffect(()=>{
        setLoading(false);
       });

  return (
    <>
    {loading ? (<Spinner/>) : (<FormControlLabel
    control={<Checkbox 
    icon={<FavoriteBorder />} 
    checkedIcon={<Favorite />} 
    name="checkedH" />}
    label="PET!"/>
    )}
    </>
  )
}

export default Loading
